import { Outlet } from "react-router-dom";
import SideBar from "./components/sidebar";

const PageLayout = () => {
    
    return (
        <div className='bg-stone-800'>
            <div className="h-screen relative left-[18%] w-max flex flex-row text-white"> 
                <div className='w-[240px] border-r border-stone-400'>
                    <SideBar/>
                </div>
                <div className='w-[700px] border-r border-stone-400'>
                    <Outlet/>
                </div>
            </div>
        </div>
      )
}

export default PageLayout;
